    // Convert inputs to fixed point
//	loop_0: for (int i = 0; i < SIZE_INPUT; i++) {
//		fixed_point_input[i] = inputs[i];
//	}

	float output_layer_1[SIZE_LAYER_1] = {0};
	float output_layer_2[SIZE_LAYER_2] = {0};


	float sum;

	// Fully connected layer 1
	loop_1: for (i = 0; i < SIZE_LAYER_1; i++) {
		sum = 0;
		loop_2: for (j = 0; j < SIZE_INPUT; j++) {
			sum += inputs[j] * weights_layer_1[i][j];
		}
		sum += bias_layer_1[i];
		//ReLU activation function
		if (sum < 0) {
			output_layer_1[i] = 0;
		} else {
			output_layer_1[i] = sum;
		}

	}

	// Fully connected layer 2
	loop_3: for (i = 0; i < SIZE_LAYER_2; i++) {
		sum = 0;
		loop_4: for (j = 0; j < SIZE_LAYER_1; j++) {
			sum += output_layer_1[j] * weights_layer_2[i][j];
		}
		sum += bias_layer_2[i];
		//ReLU activation function
		if (sum < 0) {
			output_layer_2[i] = 0;
		} else {
			output_layer_2[i] = sum;
		}
	}

	// Fully connected output layer
	loop_5: for (i = 0; i < SIZE_OUTPUT; i++) {
		sum = 0;
		loop_6: for (j = 0; j < SIZE_LAYER_2; j++) {
			sum += output_layer_2[j] * weights_layer_3[i][j];
		}
		//fixed_point_output[i] = sum + bias_layer_3[i];
		outputs[i] = sum + bias_layer_3[i];
	}

